return $input.all().map(item => {
  const text = JSON.stringify(item.json);

  // Capture full URL including the signed query params
  const regex = /(https?:\/\/[^\s"]+)/;

  const match = text.match(regex);

  const fullSignedUrl = match ? match[0] : null;

  return {
    json: {
      url: fullSignedUrl
    }
  };
});

